package main

import "fmt"

func main() {
	//input := "aacecaaa"
	//input := "abcd"
	input := ""

	fmt.Println(len(shortestPalindrome(input)))
}

func shortestPalindrome(s string) string {
	switch len(s) {
	case 0:
		return ""
	case 1:
		return s
	case 2:
		if s[0] == s[1] {
			return s
		} else {
			return string(s[1]) + s
		}
	}

	if isPalindrome(s) {
		return s
	}

	prefix := 0
	suffix := 0
	base := 31
	lastIndex := 0
	power := 1
	mod := 1000000007
	sArr := []byte(s)

	for i, c := range sArr {
		code := c - 97 + 1

		prefix = (prefix * base) % mod
		prefix = (prefix + int(code)) % mod

		suffix = (suffix + int(code)*power) % mod
		power = (power * base) % mod

		if prefix == suffix {
			lastIndex = i
		}
	}

	sfx := s[lastIndex+1:]

	return reverse(sfx) + s
}

func isPalindrome(s string) bool {
	var l = len(s)

	if l == 1 {
		return true
	}
	if l == 2 {
		return s[0] == s[1]
	}

	var i1, i2 int

	if l%2 == 0 {
		i2 = l / 2
		i1 = i2 - 1
	} else {
		i2 = l/2 + 1
		i1 = i2 - 2
	}

	for ; i1 >= 0 && s[i1] == s[i2]; i1, i2 = i1-1, i2+1 {
	}

	return i1 < 0
}

func reverse(s string) string {
	l := len(s)

	if l == 1 {
		return s
	}

	bytes := make([]byte, l)

	for i := l - 1; i >= 0; i-- {
		bytes[l-i-1] = s[i]
	}

	return string(bytes)
}
